const apiUrl = 'https://api.unsplash.com/photos/?client_id=rqvlp8dmdA61y6UyNy0YhAfNLMfLuKrAdBiKMcLqweI';
const api = 'http://localhost:3001';

export default {
  getExploreImages: () => {
    try {
      return fetch(`${apiUrl}`)
        .then((response) => response.json())
        .catch((err) => console.log(err));
    } catch (err) {
      console.log('error handler inside try', err);
    }
  },

  getUserImages: (id) => {
    try {
      console.log('idi',id)
      return fetch(`${api}/images/${id}`)
        .then((response) => response.json())
        .then((response) => console.log('response', response.message))
        .catch((err) => console.log(err));
    } catch (err) {
      console.log('error handler inside try', err);
    }
  },
};
